import React from 'react'
import Link from '../src/Link'

import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

import styled from 'styled-components'
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';


const useStyles = makeStyles(theme => ({
    '@global': {
        body: {
            backgroundColor: theme.palette.common.white
        },
        ul: {
          margin: 0,
          padding: 0,
        },
        li: {
            listStyle: 'none'
        }
    },
    appBar: {
        borderBottom: `1px solid ${theme.palette.divider}`,        
        [theme.breakpoints.down('sm')]: {
          marginTop: '1em'
        },
        [theme.breakpoints.up('sm')]: {
          marginTop: '0em'
        }
      },
      toolbar: {
        flexWrap: 'wrap',
      },
      toolbarTitle: {
        
      },
      link: {
        margin: theme.spacing(1, 1.5),
        textTransform: 'none'
      },
    nav: {
      marginLeft: '1%',
      [theme.breakpoints.down('xs')]: {
        display: 'none'
      }
    },
    menuButton: {
      display: 'none',
      [theme.breakpoints.down('xs')]: {
        display: 'inline'
      }
    },
}))

const StyledAppBar = styled(AppBar)`
  @media screen and (min-width:601px) and (max-width:660px) {
    margin-top: 1em;
  }
`

const Header = () => {
    const classes = useStyles();

    return (    
        <>
         <CssBaseline />
         <StyledAppBar position="static" color="inherit" elevation={0} className={classes.appBar}>
         <Toolbar className={classes.toolbar}> 
         <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" color="inherit" noWrap className={classes.toolbarTitle}>
           <Link href="/">
              Title
           </Link>
          </Typography>
          <nav className={classes.nav}>
            <Link href="/page" variant="button" color="textPrimary" className={classes.link}>
              Page
            </Link>
            <Link href="/tags" variant="button" color="textPrimary" className={classes.link}>
              <a>Tags</a>
            </Link>
            <Link href="/popular" color="textPrimary" className={classes.link}>
              Popular
            </Link>
            <Link href="/about" color="secondary">
          Go to the about page
        </Link>
          </nav>              
        </Toolbar>
      </StyledAppBar>
      </>
    )
}

export default Header
